import React from 'react';

function Cart({ cartItems }) { // Receive cartItems as a prop
  return (
    <div className="cart-container">
      <h2>Cart</h2>
      <div className="cart-items">
        {cartItems.map(item => (
          <div className="cart-item" key={item.id}>
            <h3>{item.name}</h3>
            <p>Price: {item.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Cart;
